import image4 from "./assets/img4.jpg";
import image5 from "./assets/img5.jpg";
import image6 from "./assets/img6.jpg";

const data = {
    products: [
      {
        id: "4",
        name: 1,
        price: 15,
        image: image4,
      },
      {
        id: "5",
        name: 2,
        price: 15,
        image: image5,
      },
      {
        id: "6",
        name: 3,
        price: 15,
        image: image6,
      },
    ],
  };
  export default data;
